import {BarChart, XAxis, YAxis, Tooltip, Legend, Bar,CartesianGrid} from 'recharts';

let data = [
    {
        "name": "Snowflake",
        "exp": 3.2
    },

    {
        "name": "Python",
        "exp": 4.5
    },
    {
        "name": "Unity/C#",
        "exp": 0.5
    },
    {
        "name": "Huggingface",
        "exp": 1
    },
    {
        "name": "bash",
        "exp": 0.8
    },
    {
        "name": "dbt",
        "exp": 2
    },
    {
        "name": "Looker",
        "exp": 1
    },
    {
        "name": "Tableau",
        "exp": 1
    },
    {
        "name": "NodeJS",
        "exp": 1
    },
    {
        "name": "React",
        "exp": 0.5
    },
    {
        "name": "SQL",
        "exp": 5
    },
    {
        "name": "Linux",
        "exp": 1
    }
].sort((a, b) => b.exp - a.exp);


export default function SkillBar(){
    return (

                    <BarChart width={1000} height={500} data={data} layout="vertical">
                    <CartesianGrid strokeDasharray="5 5" />
                        <XAxis dataKey="exp" label={{value:"Experience (Years)", position:"bottom"}} />
                        <YAxis dataKey="name" label={{value:"Skill",angle:-90,position:"insideLeft"}}/>
                        <Tooltip />
                        <Bar dataKey="exp"  fill="#49416D" />
                    </BarChart>

    );
}
